import urlJoin from "url-join";
import { httpGetSimple } from "./makeRequest.js";
export async function requestFrogCryptoGetScoreboard(zupassServerUrl) {
    return httpGetSimple(urlJoin(zupassServerUrl, "/frogcrypto/scoreboard"), async (resText) => ({
        value: JSON.parse(resText),
        success: true
    }));
}
